import React from 'react';
import { Link ,Outlet} from 'react-router-dom';
function Main(props) {
    function exitUser()
    {
        localStorage.removeItem(props.currentUser.username);
    }
    return (

     <div>
         
            <form>
                <ul>
                <h1>{props.currentUser.username}</h1>
                <li><Link to="/Main/Info">info</Link></li>
                <li><Link to="/Main/Posts">Posts</Link></li>
                <li><Link to="/Main/Albums">Albums</Link></li>
                <li><Link to="/Main/Todos">Todos</Link></li>
                <li><Link to="/Mai/" onClick={exitUser}>LogOut</Link></li>
                <Outlet/>
                </ul>
            </form>
            </div>

    );
}
export default Main;
